    "2013-03-14T19:26:29.127930",nt"name": "crsmp-potential-coastal-and-upland-borrow-sites-2012",nt"isopen":
    false,nt"url": null,nt"notes": "Upland debris basins and coastal borrow
    sites as identified originally in the California Shoreline Database compiled by
    Noble Consultants (Jon Moore). Later updates to the dataset by the BEACON, SANDAG
    and AMBAG Coastal Sediment Regional Master Plans (CSRMPs) for Ventura and Santa
    Barbara counties, San Diego County and Southern Monterey Bay, respectively.The upland
    borrow sites are from the lastest version of the data, last updated in October 2012.
    Changes include: added Sed_Source (type of sediment potentially available) and DataSource
    (identifies from where the data point was most recently identified) attributes.
    Layer now reflects various types of sediment sources in addition to debris basins,
    and includes locations from San Diego, Southern Monterey Bay, and Orange County
    Coastal Regional Sediment Management Plans.Coastal and nearshore sediment borrow
    sites were added into this dataset in May 2012.",nt"license_title": null,nt"extras":
